//import images
import logo from './images/LogoHortus.png'

//import stylesheets
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

// import components
import {Helmet} from 'react-helmet';
import {Row, Col} from 'react-bootstrap';
import Determine from './components/Determine';

function App() {
	return (
	<div className="App">
		{/*Navigation bar title*/}
		<Helmet>
			<title> Stoepplantjes </title>
		</Helmet>

		{/*Header*/}
		<div className="header">
			<Row>
				<Col className="logo" md={4} lg={2}>
						<img src={logo} alt="Hortus Botanicus" width="100%"/>
				</Col>
				<Col className ="title" md={6} lg={8}>
						<h1> Welk stoepplantje heb ik gevonden? </h1>
				</Col>
				<Col md={3} lg={2}></Col>
			</Row>
		</div>

		{/*Content*/}
		<Determine/>

		{/*Footer*/}
		<div class="footer">
			<div class="col">
				<a href="https://www.facebook.com/stoepplantjes" class="fa fa-facebook"></a>
				<a href="https://twitter.com/stoepplantjes" class="fa fa-twitter"></a>
				<a href="https://www.instagram.com/stoepplantjes/" class="fa fa-instagram"></a>
			</div>
		</div>
	</div>
	);
}

export default App;
